import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SaveUserData from './pages/SaveUserData';
import FetchUserData from './pages/FetchUserData';

function App() {
  return (
    <Router future={{ v7_startTransition: true, v7_relativeSplatPath: true }}>
      <div style={styles.container}>
        <header style={styles.header}>
          <h1 style={styles.title}>Blockchain User Data Manager</h1>
          <nav style={styles.nav}>
            <Link to="/" style={styles.navLink}>
              Save Data
            </Link>
            <Link to="/fetch" style={styles.navLink}>
              Fetch Data
            </Link>
          </nav>
        </header>
        <main style={styles.main}>
          <Routes>
            <Route path="/" element={<SaveUserData />} />
            <Route path="/fetch" element={<FetchUserData />} />
          </Routes>
        </main>
        <footer style={styles.footer}>
          <p>Â© 2024 My Blockchain App. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#f4f4f9',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '15px 20px',
    textAlign: 'center',
  },
  title: {
    margin: 0,
    fontSize: '24px',
  },
  nav: {
    marginTop: '10px',
  },
  navLink: {
    marginRight: '20px',
    textDecoration: 'none',
    color: 'white',
    fontWeight: 'bold',
    fontSize: '18px',
  },
  main: {
    flex: 1,
    padding: '20px',
    maxWidth: '900px',
    margin: '0 auto',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    textAlign: 'center',
    padding: '10px 20px',
  },
};

export default App;
